import { Parser, ZORA_TOKEN_ADDRESS } from '../../src'
import METADATA_STUB from '../mock-reponses/contracts/zora/100.json'
import { testProvider } from '../setupProvider'
import { getAddress, isAddress } from '@ethersproject/address'
import { AddressZero } from '@ethersproject/constants'

const ZORA_CRITERIA = {
  input: {
    tokenId: '100',
    tokenAddress: ZORA_TOKEN_ADDRESS,
  },
  output: {
    metadata: METADATA_STUB,
    name: METADATA_STUB.name,
    description: METADATA_STUB.description,
    contentURL:
      'https://ipfs.fleek.co/ipfs/bafkreic4zqxiofoxuf6dcefp4n5ykynyjncq3ohpz4mh3edet4qseaifb4',
    contentURLMimeType: 'text/plain',
    tokenURL:
      'https://ipfs.fleek.co/ipfs/bafkreic364j5bx3tai5esijlnicpssmmudqlo4nwz5reftkpz6w2qrdhym',
    tokenURLMimeType: 'application/json',
  },
}

const ZORA_BURNT_CRITERIA = {
  input: {
    tokenId: '828',
    tokenAddress: ZORA_TOKEN_ADDRESS,
  },
  output: {
    metadata: {
      description:
        'Part one in the nine part isolation series. All works work created in the last year inspired by dreams while in quarantine.\n\ndigital image 1280 x 1706 png c. 2020',
      mimeType: 'image/png',
      name: 'ISOLATION : ONE',
      version: 'zora-20210101',
    },
    contentURL:
      'https://ipfs.fleek.co/ipfs/bafybeie7ebeupimyxmq4ytykyabw3iuyivzat4tnqmvtcsr24cetcmicgi',
    contentURLMimeType: 'image/png',
    description:
      'Part one in the nine part isolation series. All works work created in the last year inspired by dreams while in quarantine.\n\ndigital image 1280 x 1706 png c. 2020',
    name: 'ISOLATION : ONE',
    tokenURL:
      'https://ipfs.fleek.co/ipfs/bafybeihglhwbzvrqyue7af2cqz4s6gtg7ylwrhd2uqebv3eo36kpbl32ne',
    tokenURLMimeType: 'application/json',
    ownerAddress: getAddress(AddressZero),
  },
}

const ZORA_NON_URL_CRITERIA = {
  input: {
    tokenId: '3313',
    tokenAddress: ZORA_TOKEN_ADDRESS,
  },
  output: {
    contentURL:
      'data:application/json;base64,',
    contentURLMimeType: 'application/json',
    description:
      'This NFT represents a liquidity position in a Uniswap V3 ASH-WETH pool. The owner of this NFT can modify or redeem the position.\n\nPool Address: 0x3ee301ed8f42d106def4f9d9730ea3367880b771\nASH Address: 0x64d91f12ece7362f91a6f8e7940cd55f05060b92\nWETH Address: 0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2\nFee Tier: 1%\nToken ID: 25042\n\n⚠️ DISCLAIMER: Due diligence is imperative when assessing this NFT. Make sure token addresses match the expected tokens, as token symbols may be imitated.',
    metadata: {
      description:
        'This NFT represents a liquidity position in a Uniswap V3 ASH-WETH pool. The owner of this NFT can modify or redeem the position.\n\nPool Address: 0x3ee301ed8f42d106def4f9d9730ea3367880b771\nASH Address: 0x64d91f12ece7362f91a6f8e7940cd55f05060b92\nWETH Address: 0xc02aaa39b223fe8d0a0e5c4f27ead9083c756cc2\nFee Tier: 1%\nToken ID: 25042\n\n⚠️ DISCLAIMER: Due diligence is imperative when assessing this NFT. Make sure token addresses match the expected tokens, as token symbols may be imitated.',
      image:
        'data:image/svg+xml;base64,',
      name: 'Uniswap - 1% - ASH/WETH - 879.77<>972.29',
    },
    name: 'Uniswap - 1% - ASH/WETH - 879.77<>972.29',
    ownerAddress: '0xf598AaDF12a2FC4709b5Db0C4c169715EFAf2038',
    tokenURL:
      'data:application/json;base64,',
    tokenURLMimeType: 'application/json',
  },
}

describe('Zora ERC721', () => {
  const parser = new Parser(testProvider, 'https://ipfs.fleek.co')

  beforeEach(() => {
    jest.setTimeout(20000)
  })

  it(`should be able to fetch and parse metadata for token id: ${ZORA_CRITERIA.input.tokenId}`, async () => {
    const { ownerAddress, ...meta } = await parser.fetchAndParseTokenMeta(
      ZORA_CRITERIA.input.tokenAddress,
      ZORA_CRITERIA.input.tokenId,
    )
    expect(meta).toStrictEqual(ZORA_CRITERIA.output)
    expect(isAddress(ownerAddress)).toBeTruthy()
  })

  it(`should be able to fetch and parse metadata for burnt token id: ${ZORA_BURNT_CRITERIA.input.tokenId}`, async () => {
    const meta = await parser.fetchAndParseTokenMeta(
      ZORA_BURNT_CRITERIA.input.tokenAddress,
      ZORA_BURNT_CRITERIA.input.tokenId,
    )
    expect(meta).toStrictEqual(ZORA_BURNT_CRITERIA.output)
  })

  it(`should be able to fetch and parse metadata for burnt token id 3313`, async () => {
    const meta = await parser.fetchAndParseTokenMeta(
      ZORA_TOKEN_ADDRESS,
      ZORA_NON_URL_CRITERIA.input.tokenId,
    )
    expect(meta).toStrictEqual(ZORA_NON_URL_CRITERIA.output)
  })
})
